{
  "translationLines": [
    {
      "lineNumber": 195412,
      "originalJapaneseLine": "あっという間に山賊は倒された。",
      "translatedEnglishLine": "The bandits were defeated in the blink of an eye."
    },
    {
      "lineNumber": 195413,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195414,
      "originalJapaneseLine": "長田君はあなたをチラチラと窺っている。",
      "translatedEnglishLine": "Nagata-kun was glancing at you repeatedly."
    },
    {
      "lineNumber": 195415,
      "originalJapaneseLine": "「あ、あのよぉ……＜エール＞……」",
      "translatedEnglishLine": "“Uh, um... <Ale>...”"
    },
    {
      "lineNumber": 195416,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195417,
      "originalJapaneseLine": "「あっ……」",
      "translatedEnglishLine": "“Ah...”"
    },
    {
      "lineNumber": 195418,
      "originalJapaneseLine": "「……うっ」",
      "translatedEnglishLine": "“...Ugh”"
    },
    {
      "lineNumber": 195419,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195420,
      "originalJapaneseLine": "長田君は瞼をぐしぐしとぬぐった。",
      "translatedEnglishLine": "Nagata rubbed his eyelids vigorously."
    },
    {
      "lineNumber": 195421,
      "originalJapaneseLine": "「＜エール＞……ごめんな……」",
      "translatedEnglishLine": "“<Ale>... I'm sorry...”"
    },
    {
      "lineNumber": 195422,
      "originalJapaneseLine": "長田君がボソリと何か呟いた。",
      "translatedEnglishLine": "Nagata muttered something quietly."
    },
    {
      "lineNumber": 195423,
      "originalJapaneseLine": "「へへっ！　さあ、冒険の続きだな！」",
      "translatedEnglishLine": "“Hehe! Now, let’s continue the adventure!”"
    },
    {
      "lineNumber": 195424,
      "originalJapaneseLine": "あなたの出した手を、",
      "translatedEnglishLine": "He took the hand you reached out,"
    },
    {
      "lineNumber": 195425,
      "originalJapaneseLine": "長田君がぎゅっと握った。",
      "translatedEnglishLine": "Nagata gripped it tightly."
    },
    {
      "lineNumber": 195426,
      "originalJapaneseLine": "「うっ、わ、悪かったよぉ！",
      "translatedEnglishLine": "“Ugh, I-I'm sorry!"
    },
    {
      "lineNumber": 195427,
      "originalJapaneseLine": "　マジ、反省してるって！」",
      "translatedEnglishLine": "I seriously regret it!”"
    },
    {
      "lineNumber": 195428,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195429,
      "originalJapaneseLine": "「いや、俺は何も言う資格はねぇな……",
      "translatedEnglishLine": "“No, I have no right to say anything..."
    },
    {
      "lineNumber": 195430,
      "originalJapaneseLine": "　気の済むまで俺を罵倒してくれ！」",
      "translatedEnglishLine": "Insult me as much as you want!”"
    },
    {
      "lineNumber": 195431,
      "originalJapaneseLine": "あなたは長田君を罵倒した。",
      "translatedEnglishLine": "You insulted Nagata-kun."
    },
    {
      "lineNumber": 195432,
      "originalJapaneseLine": "「ああ……」",
      "translatedEnglishLine": "“Ah...”"
    },
    {
      "lineNumber": 195433,
      "originalJapaneseLine": "まだまだ罵倒した。",
      "translatedEnglishLine": "You continued to insult him even more."
    },
    {
      "lineNumber": 195434,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195435,
      "originalJapaneseLine": "思いつく限りのありとあらゆる言葉で",
      "translatedEnglishLine": "Using every imaginable word,"
    },
    {
      "lineNumber": 195436,
      "originalJapaneseLine": "長田君を罵った。",
      "translatedEnglishLine": "you insulted Nagata-kun."
    },
    {
      "lineNumber": 195437,
      "originalJapaneseLine": "「ウキーーーッ！」",
      "translatedEnglishLine": "“Ukiiii!”"
    },
    {
      "lineNumber": 195438,
      "originalJapaneseLine": "長田君は顔を真っ赤にしながら、",
      "translatedEnglishLine": "Nagata's face turned bright red as he,"
    },
    {
      "lineNumber": 195439,
      "originalJapaneseLine": "あなたに体当たり、体当たり。",
      "translatedEnglishLine": "bumped into you, bumped into you."
    },
    {
      "lineNumber": 195440,
      "originalJapaneseLine": "「そこまで言うこたーねぇじゃねぇか！",
      "translatedEnglishLine": "“You don’t have to say it that much!"
    },
    {
      "lineNumber": 195441,
      "originalJapaneseLine": "　このすっとこどっこい！」",
      "translatedEnglishLine": "You idiot!”"
    },
    {
      "lineNumber": 195442,
      "originalJapaneseLine": "「この、このこのこの！」",
      "translatedEnglishLine": "“You, you, you, you!”"
    },
    {
      "lineNumber": 195443,
      "originalJapaneseLine": "「へ、へへっ……」",
      "translatedEnglishLine": "“He, hehe...”"
    },
    {
      "lineNumber": 195444,
      "originalJapaneseLine": "「＜エール＞……ごめんな……」",
      "translatedEnglishLine": "“<Ale>... I'm sorry...”"
    },
    {
      "lineNumber": 195445,
      "originalJapaneseLine": "長田君がボソリと何か呟いた。",
      "translatedEnglishLine": "Nagata muttered something quietly."
    },
    {
      "lineNumber": 195446,
      "originalJapaneseLine": "「さあ、早くここのボスに会いに行こうぜ！」",
      "translatedEnglishLine": "“Come on, let’s go meet the boss here quickly!”"
    },
    {
      "lineNumber": 195447,
      "originalJapaneseLine": "「あいてっ……」",
      "translatedEnglishLine": "“Ouch...”"
    },
    {
      "lineNumber": 195448,
      "originalJapaneseLine": "「＜エール＞……？」",
      "translatedEnglishLine": "“<Ale>...?”"
    },
    {
      "lineNumber": 195449,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195450,
      "originalJapaneseLine": "「へっ……」",
      "translatedEnglishLine": "“Heh...”"
    },
    {
      "lineNumber": 195451,
      "originalJapaneseLine": "「＜エール＞……ごめんな……」",
      "translatedEnglishLine": "“<Ale>... I'm sorry...”"
    },
    {
      "lineNumber": 195452,
      "originalJapaneseLine": "長田君がボソリと何か呟いた。",
      "translatedEnglishLine": "Nagata muttered something quietly."
    },
    {
      "lineNumber": 195453,
      "originalJapaneseLine": "「へへっ、じゃあとっとと",
      "translatedEnglishLine": "“Hehe, well then, quickly"
    },
    {
      "lineNumber": 195454,
      "originalJapaneseLine": "　このアジトでやること済ませちまおうぜ！」",
      "translatedEnglishLine": "let’s finish what we need to do at this hideout!”"
    },
    {
      "lineNumber": 195455,
      "originalJapaneseLine": "「うるうる……",
      "translatedEnglishLine": "“Tearfully..."
    },
    {
      "lineNumber": 195456,
      "originalJapaneseLine": "　感動的だすなぁ……」",
      "translatedEnglishLine": "So touching...”"
    },
    {
      "lineNumber": 195457,
      "originalJapaneseLine": "ロッキーは勝手に感動して泣いていた。",
      "translatedEnglishLine": "Rocky was moved on his own and was crying."
    },
    {
      "lineNumber": 195458,
      "originalJapaneseLine": "あなたは友達と初めての仲直りをした。",
      "translatedEnglishLine": "You made up with your friend for the first time."
    },
    {
      "lineNumber": 195459,
      "originalJapaneseLine": "「よーし、目指すはランスJr.のいる部屋だ！」",
      "translatedEnglishLine": "“Alright, our target is the room where Rance Jr. is!”"
    },
    {
      "lineNumber": 195460,
      "originalJapaneseLine": "「＜エール＞の兄貴の顔を見に行こうぜ！」",
      "translatedEnglishLine": "“Let’s go see <Ale>’s big brother!”"
    },
    {
      "lineNumber": 195461,
      "originalJapaneseLine": "アジト内部をひたすらに進み、",
      "translatedEnglishLine": "You steadily advanced deeper into the hideout,"
    },
    {
      "lineNumber": 195462,
      "originalJapaneseLine": "ついにあなたは最深部に辿り着いた。",
      "translatedEnglishLine": "and finally reached the deepest part."
    },
    {
      "lineNumber": 195463,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "“……”"
    },
    {
      "lineNumber": 195464,
      "originalJapaneseLine": "一際大きな巨大な鉄の扉が、",
      "translatedEnglishLine": "An exceptionally large, huge iron door"
    },
    {
      "lineNumber": 195465,
      "originalJapaneseLine": "あなたの行く手を阻むように立ち塞がっている。",
      "translatedEnglishLine": "stood blocking your path."
    },
    {
      "lineNumber": 195466,
      "originalJapaneseLine": "「＜エール＞様、長田君。",
      "translatedEnglishLine": "“<Ale>-sama, Nagata-kun."
    },
    {
      "lineNumber": 195467,
      "originalJapaneseLine": "　ここが、アジトの最奥……",
      "translatedEnglishLine": "This is the innermost part of the hideout..."
    },
    {
      "lineNumber": 195468,
      "originalJapaneseLine": "　そして、ランスJr.様のお部屋だす」",
      "translatedEnglishLine": "And here is the room of Rance Jr., sir.”"
    },
    {
      "lineNumber": 195469,
      "originalJapaneseLine": "「おらが＜エール＞様の味方についたことは",
      "translatedEnglishLine": "“I don’t think it’s been known yet that I sided with <Ale>-sama,"
    },
    {
      "lineNumber": 195470,
      "originalJapaneseLine": "　まだ知られてないと思うので、",
      "translatedEnglishLine": "so"
    },
    {
      "lineNumber": 195471,
      "originalJapaneseLine": "　話し合いくらいは出来ると思うだすが……」",
      "translatedEnglishLine": "I think we might at least be able to negotiate...”"
    }
  ]
}

